import React from 'react';
import {
    Col,
    FormGroup,
    Input,
    Label,
    Row,
  } from 'reactstrap';

//Date Picker
import { DateTimePicker } from 'react-widgets';
import Moment from 'moment';
import momentLocalizer from 'react-widgets-moment';
//Dtate Picker package
Moment.locale('en');
momentLocalizer();

export default function MaterialUIPickers() {
    // The first commit of Material-UI


    return (

        <Row form>
        <Col md={4}>
        <FormGroup>
            <Label for="hospitalNumber">Visit Type</Label>
            <FormGroup>
                <Label for="qualification">Hightest Qualification</Label>
                <Input type="select" name="educationId" >
                    <option value="1">PHD</option>
                    <option value="2">MSC</option>
                    <option value="3">BSC</option>
                    <option value="4">HND</option>
                    <option value="5">NCE</option>
                </Input>
            </FormGroup>
        </FormGroup>
        </Col>

        <Col md={4}>
        <FormGroup>
            <Label for="middleName">Date Of Registration</Label>

            <DateTimePicker time={false} name="dateRegistration"  id="dateRegistration"   />
        </FormGroup>
        </Col>

    </Row>
    );
}
